import React from 'react';

class Home extends React.Component{
    constructor(props){
        super(props)
    }
    render(){
        return <div>
            <h1 style={styles.title} >Home Page</h1>
            <div style={styles.warper}>
                <div style={styles.containers}>Container</div>
                <div style={styles.containers}>Container</div>
                <div style={styles.containers}>Container</div>
            </div>
        </div>
    }
}

const styles = {
    warper: {
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between'
    },
    containers: {
        margin: 100,
        selfAlign: 'center'
    },
    title: {
        alignSelf: 'center',
        border: '20px'
    }
}

export default Home;
